### Describe the issue

I implemented a program with GPT NEO in python (attached the program) and the equivalent version in C++. To acquire the exported GPT NEO model I made some slight modifications to the optimize tool (https://github.com/microsoft/onnxruntime/issues/11810).

I have executed the two programs increasing the size of the input (the history) and I obtained the execution time for 30 cycles. The results are the following:

![image](https://user-images.githubusercontent.com/6554457/227421673-7a47b65f-60f7-4876-aa2d-7b222842e5cb.png)

As you can see, python program has a better performance and it no makes sense to me.

Gpt neo was exported but possibly not optimized?

Any suggestion is welcome, thank you very much!

Note: Before I explore the part of running with gpu I want to exhaust the possibility that I am doing something wrong so that the performance is worse than your version of python.




### To reproduce

Python program

```
import time
import torch

from transformers import GPTNeoForCausalLM, GPT2Tokenizer
model = GPTNeoForCausalLM.from_pretrained("EleutherAI/gpt-neo-1.3B")
tokenizer = GPT2Tokenizer.from_pretrained("EleutherAI/gpt-neo-1.3B")
device = torch.device('cpu')
print("=======Start===============\n")

n = 30
sum1 = 0
prompt = "William: Hi. How have you been?\nAnna: I've been good! What about you?\nWilliam: I'm feel good. Just working and life.\nAnna: You know, the life is a risk.\nWilliam: You look very young. How old are you?\nAnna: Thank you. I'm 23 years old.\n"
size = 0

for x in range(n):
    input_ids = tokenizer(prompt, return_tensors="pt").input_ids
    s = input_ids[0].size(dim=0)
    size = s + 20
    start_time = time.time()
    gen_tokens = model.generate(
       input_ids,
       do_sample=True,
       temperature=0.9,
       max_length=size,
    )
    duration = time.time() - start_time
    print("Size: ", size)
    gen_text = tokenizer.batch_decode(gen_tokens)[0]
    print("N: ", x)
    print("--- %s seconds ---" % duration)
    sum1 = sum1 + duration
    prompt = gen_text
    print(prompt)

average = sum1 / n
print("Average: ", average)
print("------GPT-NEO-------")
```

C++ program: Too much code is required to reproduce it in c++, but I'm sharing the essential code where onnxrutime is applied to give the basic idea of how I'm implementing it.

```
void GPTNeo::LoadModel(std::string path)
{
       	k_max_length = 20;
	k_min_length = 0;
