	mbstowcs(wc, model_path.c_str(), cSize);
	session = Ort::Session(env, wc, sess_options);
	delete[] wc;

}

void  GPTNeo::RunGPTNeo(std::vector<int32_t>& input_ids, std::vector<int32_t>& ouputs_ids)
{
	int64_t k_input_size = input_ids.size();
	std::array<int64_t, 2> input_shape{ 1, k_input_size };
	const array<int64_t, 1> args_shape = { 1 };

	std::vector<int32_t> max_length(1);
	std::vector<int32_t> min_length(1);
	std::vector<int32_t> num_beams(1);
	std::vector<int32_t> num_return_sequences(1);
	std::vector<float> length_penalty(1);
	std::vector<float> repetition_penalty(1);

	max_length[0] = k_input_size + k_max_length;
	min_length[0] = 1;
	num_beams[0] = k_num_beams;
	num_return_sequences[0] = k_num_return_sequences;
	length_penalty[0] = k_length_penalty;
	repetition_penalty[0] = k_repetition_penalty;

	Ort::MemoryInfo memory_info = Ort::MemoryInfo::CreateCpu(OrtDeviceAllocator, OrtMemTypeDefault);

	std::vector<Ort::Value> input_tensors;
	input_tensors.push_back(Ort::Value::CreateTensor<int32_t>(memory_info, input_ids.data(), input_ids.size(), input_shape.data(), input_shape.size()));
	input_tensors.push_back(Ort::Value::CreateTensor<int32_t>(memory_info, max_length.data(), max_length.size(), args_shape.data(), args_shape.size()));
	input_tensors.push_back(Ort::Value::CreateTensor<int32_t>(memory_info, min_length.data(), min_length.size(), args_shape.data(), args_shape.size()));
	input_tensors.push_back(Ort::Value::CreateTensor<int32_t>(memory_info, num_beams.data(), num_beams.size(), args_shape.data(), args_shape.size()));
	input_tensors.push_back(Ort::Value::CreateTensor<int32_t>(memory_info, num_return_sequences.data(), num_return_sequences.size(), args_shape.data(), args_shape.size()));
	input_tensors.push_back(Ort::Value::CreateTensor<float>(memory_info, length_penalty.data(), length_penalty.size(), args_shape.data(), args_shape.size()));
	input_tensors.push_back(Ort::Value::CreateTensor<float>(memory_info, repetition_penalty.data(), repetition_penalty.size(), args_shape.data(), args_shape.size()));

	// define names
	Ort::AllocatorWithDefaultOptions allocator;
	std::vector < const char*> input_names;
	input_names.push_back(session.GetInputName(0, allocator));
	input_names.push_back(session.GetInputName(1, allocator));
	input_names.push_back(session.GetInputName(2, allocator));
	input_names.push_back(session.GetInputName(3, allocator));
	input_names.push_back(session.GetInputName(4, allocator));
	input_names.push_back(session.GetInputName(5, allocator));
	input_names.push_back(session.GetInputName(6, allocator));

	std::vector < const char*> output_names;
	output_names.push_back(session.GetOutputName(0, allocator));
	ouputs_ids.clear();

	// run inference
	try {
		auto output_tensors = session.Run(Ort::RunOptions{ nullptr }, input_names.data(), input_tensors.data(), 7, output_names.data(), 1);
		int32_t* result = output_tensors.front().GetTensorMutableData<int32_t>();
		auto n_elements = output_tensors.front().GetTensorTypeAndShapeInfo().GetElementCount();
		//cout << "k_input_size: " << k_input_size << "n_elements: " << n_elements << endl;
		for (int i = k_input_size; i < n_elements; i++) {
			if (result[i] == (int32_t)EOS_ID) {
				break;
			}
			ouputs_ids.push_back(result[i]);
		}
	}
	catch (Ort::Exception& e) {
		cout << e.what() << endl;
	}
}
```


